import styled from 'styled-components';

export const Title = styled.h1`
text-align: center;
font-size: 2rem;
font-family: sans-serif;
color: #333;
`

export const List = styled.ul`
list-style:none;
padding:none;
font-family: sans-serif;
`

export const ListItem = stle.li`
margin: .5rem 0
`
